  return (
    <div className="App">
      <header className="App-header">
      <p> Je suis itachi uchiwa </p>
        <img src={logo}  alt="itachi" />

      </header>
    </div>
  );
}
else{
  return (
    <div className="App">
      <header className="App-header">
      <p> Failure</p>


      </header>
    </div>
  )
}
}

export default App;
